import React from 'react'
import Exfloorcard from './Exhistorycompo/Exfloorcard'
import { makeStyles } from '@material-ui/core/styles';
import Datetoday from '../../Components/AllComponent/Datetoday.js'
import { ScrollView } from 'react-native';
import Navbar2 from '../../Components/AllComponent/Navbar2';
import { useState } from 'react';
import { Button } from '@material-ui/core';
import axios from 'axios';
import { useEffect } from 'react';

const useStyles = makeStyles((theme) => ({
    frame: {
        width: '1163px',
        height: '232px',
        backgroundColor: 'red',
    },
    scrollspace: {
        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 110,
        transition: 'all 0.5s ease'

    },
    scrollspace36: {
        height: "730px",
        width: '1163px',
        margin: 'auto',
        paddingLeft: 36,
        transition: 'all 0.5s ease'
    }
}));

export default function Exhistorypage({isOpened}) {
    const classes = useStyles();
   const [setFloor, setAllFloor] = useState([])

    useEffect(() => {
        axios('/history/expense-history/King David/date/2021-07-08')
            .then(response => {
                console.log(response.data)
                setAllFloor(response.data);
            })
            .catch(error => {
                console.log('Error getting fake data: ' + error);
            })
    }, []);

    return (

        <ScrollView>
            <div className={isOpened ? classes.scrollspace36 : classes.scrollspace}>
                <div>
                    <div className={classes.frame}>
                        <Datetoday />
                        {/* <Button  style={{backgroundColor: 'blue'}} onClick={() => props.isOpened('Anna')}/> */}
                    </div>

                    <div>
                        <Exfloorcard 
                        getFloors = {setFloor}
                        />
                    </div>
                </div>
            </div>
        </ScrollView>

    )
}
